import { reduxForm, Field } from 'redux-form'
import { connect } from 'react-redux'
import React from 'react'

const UserFormFunc = props => {
    return (
        <form>
            <label>
                Name
           </label>
            <Field
                type="text"
                component="input"
                name="name" />
            <label>
                Email
           </label>
            <Field
                type="text"
                component="input"
                name="email" />

        </form>
    );
}

const UserForm = (reduxForm({
    form: 'formUser'
}))(UserFormFunc)

